import './App.css';
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <div>
      <Routes>
      <Route path="/" element={<div>1</div>}/>
      <Route path="/affiliate" element={<div>2</div>}/>
      <Route path="/register" element={<div>3</div>}/>
      <Route path="/affiliate/register" element={<div>4</div>}/>
      </Routes>
    </div>
  );
}

export default App;
